// App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

function Home() {
  return <h2 className="page">This is the Home Page</h2>;
}
function About() {
  return <h2 className="page">This is the About Page</h2>;
}
function Services() {
  return <h2 className="page">This is the Services Page</h2>;
}
function Portfolio() {
  return <h2 className="page">This is the Portfolio Page</h2>;
}
function Gallery() {
  return <h2 className="page">This is the Gallery Page</h2>;
}
function Contact() {
  return <h2 className="page">This is the Contact Page</h2>;
}

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="logo">Growt<span>ech</span></div>
          <ul className="nav-links">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/services">Services</Link></li>
            <li><Link to="/portfolio">Portfolio</Link></li>
            <li><Link to="/gallery">Gallery</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
          <a href="/resumes/resume1.pdf" target="_blank" rel="noreferrer" className="btn-resume">Download CV</a>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/services" element={<Services />} />
          <Route path="/portfolio" element={<Portfolio />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
